import (
	"fmt"
	"math/rand"
	"time"
)

func main() {
	rand.Seed(time.Now().UnixNano())
	diceNumber := rand.Intn(6) + 1
	fmt.Println("Value of dice is ", diceNumber)

	switch diceNumber {
	case 1:
		fmt.Println("Dice value is 1 and you can open")
	case 2:
		fmt.Println("You can move 2 spots")
	case 3:
		fmt.Println("You can move 3 spots")
	case 4:
		fmt.Println("You can move 4 spots")
	case 5:
		fmt.Println("You can move 5 spots")
	case 6:
		fmt.Println("You can move 6 spots and roll dice again")
	default:
		fmt.Println("What was that!")
	}
}
package main

import (
	"fmt"
	"math/rand"
	"time"
)

func main() {
	rand.Seed(time.Now().UnixNano())
	// 生成一个随机数
	randomNumber := rand.Intn(100) + 1
	fmt.Println("随机数:", randomNumber)

	// 生成一个随机字符串
	letters := []rune("abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ")
	randomString := make([]rune, 10)
	for i := range randomString {
		randomString[i] = letters[rand.Intn(len(letters))]
	}
	fmt.Println("随机字符串:", string(randomString))

	// 生成一个随机日期
	min := time.Date(2020, 1, 0, 0, 0, 0, 0, time.UTC).Unix()
	max := time.Date(2023, 1, 0, 0, 0, 0, 0, time.UTC).Unix()
	delta := max - min
	sec := rand.Int63n(delta) + min
	randomDate := time.Unix(sec, 0)
	fmt.Println("随机日期:", randomDate)

	// 生成一个随机布尔值
	randomBoolean := rand.Intn(2) == 1
	fmt.Println("随机布尔值:", randomBoolean)
}
